import React, { useEffect, useState } from 'react';
import './AcceptedCV.css'; 
import { Link } from 'react-router-dom';
import axios from 'axios';

const AcceptedCVs = () => {
  const [isSidebarOpen, setSidebarOpen] = useState(false);
  const [acceptedCVs, setAcceptedCVs] = useState([]);

  const toggleSidebar = () => {
    setSidebarOpen(!isSidebarOpen);
  };

  useEffect(() => {
    fetchAcceptedCVs();
  }, []);

  const fetchAcceptedCVs = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/accepted');
      setAcceptedCVs(response.data);
    } catch (error) {
      console.error('Failed to fetch accepted CVs:', error);
    }
  };

  const deleteCV = async (id) => {
    if (window.confirm('Are you sure you want to delete this CV?')) {
      try {
        await axios.delete(`http://localhost:5000/api/accepted/${id}`);
        setAcceptedCVs((prev) => prev.filter(cv => cv._id !== id));
      } catch (error) {
        console.error('Failed to delete CV:', error);
      }
    }
  };

  return (
    <div className="main-content">
      <button className="hamburger" onClick={toggleSidebar}>â˜°</button>

      <aside className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
        <ul>
          <li><Link to="/job-creation">Job Creation</Link></li>
          <li><Link to="/job-modification">Job Modification</Link></li>
          <li><Link to="/received-cvs">Received CVs</Link></li>
          <li className="active"><Link to="/accepted-cvs"><b>Accepted CVs</b></Link></li>
        </ul>
      </aside>

      <section className="content">
        <div className="Jobcard">
          <h2>Accepted CVs</h2>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Gender</th>
                <th>Field</th>
                <th>Contact</th>
                <th>CV</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {acceptedCVs.map(cv => (
                <tr key={cv._id}>
                  <td>{cv.fullname}</td>
                  <td>{cv.gender}</td>
                  <td>{cv.field}</td>
                  <td>{cv.contact}</td>
                  <td>
                    {cv.cv ? (
                      <a href={`http://localhost:5000/uploads/${cv.cv}`} target="_blank" rel="noreferrer">
                        {cv.cv}
                      </a>
                    ) : 'No CV'}
                  </td>
                  <td>
                    <button className="delete-btn" onClick={() => deleteCV(cv._id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>
    </div>
  );
};

export default AcceptedCVs;
